Use shorthand properties where possible. These let you condense multiple properties into one. Examples include: background border border-radius inset There are a few exceptions where certain shorthand properties make CSS code harder to read. These properties are: flex font font-variation-settings grid /* bad */
.foo { padding-top: 1rem; padding-bottom: 1rem; padding-left: 1rem; padding-right: 1rem;
} /* good */
.foo { padding: 1rem;
}

