Z-index layers controls the z-coordinate of HTML elements and override the order in which they are rendered, which is known as the "stacking context". [1] However, avoid using the z-index property if possible. Use the natural order of the DOM. If this can't be avoided, the z-index of the component should be stored inside a CSS variable. All z-index variables should appear in the same stylesheet, in order from least to greatest, e.g: :root { --z-index-dialog: 100; --z-index-modal: 200;
} .dialog { z-index: var(--z-index-dialog); /** ... */
} .modal { z-index: var(--z-index-modal); /** ... */
} Example components that can and need a z-index include overlay-like elements such as popups, dialogs, and tooltips.

