For responsive design, use rem units instead of px and em (generally). The px unit is not the same value across different devices, since devices have different pixel densities. The em unit is relative to the parent element. This makes values harder to calculate and keep track of as the DOM becomes more complex. The rem unit is relative to the root element. Use numeric values on a scale if possible for consistency, such as 1/4 or 1/8: 1/4: 0, .25, .75, 1 1/8: 0, .125, .375, .625, .875, 1 (also includes 1/4 values) If a numeric value is 0, omit the unit. Omit leading zeroes. /* bad */
padding: 0.5rem 0rem; /** good */
padding: .5rem 0;

