PascalCase: classes, interfaces, types, enums, decorators, and type parameters lowerCamelCase: variables, functions, and parameters SCREAMING_CASE: constants Abbreviations should use PascalCase. The first letter is capitalized, and the rest are lowercase. However, if the abbreviation is two-letters long, like IO (input/output), both letters are capitalized. HttpRequest IOStreamReader UserId If possible, try to avoid abbreviations and acronyms, since it can be confusing. Generally, they should only be used if it is well-known within the domain. Examples include: API : Application Programming Interface REST : Representational State Transfer URI : Uniform Resource Identifier L10N : Localization // good
