There are two types of comments: Multiline comments: /** ... */ Single-line comments: //... Multiline comments must use TSDoc - a documentation standard for TypeScript. To document a function, include a one-sentence summary, one space after the start. Optionally, include a description (with a newline after the summary) that includes any details needed. Include any TSDoc annotations necessary, like @param and @return. We use the following annotations, in the given order: @example @deprecated / @experimental @link / @see @typeParam @param @returns @throws Do not include the type of the parameter in @param annotations. The type is already included in the function signature. An example function might look like: /** * @param array - collection of items to iterate over * @param callback - a function to apply over each item in the array * @returns the result of the callback function */
export function map<T>(array: T[], callback: (item: T, index: number, array: T[]) => T): T[] { let map = []; for(let i = 0; i < array.length; i++) { map.push(callback(array[i], i, array)); } return map;
}
